import React, { useContext, useState } from 'react';
import logo from '../logo.svg';




function Nav(params) {



return(
<React.Fragment>
<nav>

<div className="logo-con">

        <img src={logo}  alt="logo" />
<span>VStreamer</span>

</div>


<div>My Account</div>
<div>Videos</div>


</nav>




</React.Fragment>



)
    
}



export default Nav
